function readFile(files, filename) {
    if (!files[filename]) {
        print(`File not found: ${filename}`, 'error');
        return;
    }
    
    const file = files[filename];
    
    if (file.permission === 'e') {
        print(`Error: File is encrypted. Use decrypt command.`, 'error');
        return;
    }
    
    print(`File: ${filename}`, 'success');
    print('----------------------------------------', 'system');
    print(file.content, 'system');
    print('----------------------------------------', 'system');
}

function createFile(files, filename) {
    if (files[filename]) {
        print(`File ${filename} already exists.`, 'error');
        return;
    }
    
    files[filename] = {
        content: '',
        permission: 'rw'
    };
    
    saveFiles(files);
    print(`File ${filename} created.`, 'success');
}

function editFile(files, filename) {
    if (!files[filename]) {
        print(`File not found: ${filename}`, 'error');
        return;
    }
    
    const file = files[filename];
    
    if (file.permission !== 'rw') {
        print(`Permission denied: ${filename} is read-only or encrypted`, 'error');
        return;
    }
    
    // Create editor in an isolated section that won't hijack events
    const editorDiv = document.createElement('div');
    editorDiv.className = 'editor';
    editorDiv.innerHTML = `
        <div>Editing ${filename} (press Ctrl+S to save):</div>
        <textarea id="file-content-editor">${file.content}</textarea>
        <div>
            <button id="save-btn">Save</button>
            <button id="cancel-btn">Cancel</button>
        </div>
    `;
    
    outputElement.appendChild(editorDiv);
    
    // Focus textarea but prevent event propagation
    const textarea = document.getElementById('file-content-editor');
    
    // Isolate event handling in the textarea
    textarea.addEventListener('click', function(e) {
        e.stopPropagation();
    });
    
    textarea.addEventListener('focus', function(e) {
        e.stopPropagation();
    });
    
    // Focus the textarea
    textarea.focus();
    
    // Scroll to editor
    outputElement.scrollTop = outputElement.scrollHeight;
    
    // Save button
    document.getElementById('save-btn').addEventListener('click', function() {
        file.content = textarea.value;
        saveFiles(files);
        editorDiv.remove();
        print(`File ${filename} saved.`, 'success');
        
        // Delay focus to prevent race condition
        setTimeout(function() {
            inputElement.focus();
        }, 10);
    });
    
    // Cancel button
    document.getElementById('cancel-btn').addEventListener('click', function() {
        editorDiv.remove();
        print(`Edit canceled.`, 'system');
        
        // Delay focus to prevent race condition
        setTimeout(function() {
            inputElement.focus();
        }, 10);
    });
    
    // Ctrl+S to save
    textarea.addEventListener('keydown', function(e) {
        if (e.ctrlKey && e.key === 's') {
            e.preventDefault();
            e.stopPropagation();
            document.getElementById('save-btn').click();
        }
    });
}

